 has a narrow therapeutic index and displays marked person-to-person variation in dose requirement . Functional polymorphisms at candidate genes can therefore offer utility as biomarkers to individualize warfarin treatment . The main objective of this study was to determine whether and to what extent variability in warfarin dose requirements was determined by polymorphisms in 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 , Q9BQB6 , 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 ( rs2108622 ) and 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P07099

</mark>
 ( rs2292566 ) in the Turkish population . Patients ( n = 107 ) who had stable doses and international normalized ratio ( INRs ) at their last three consecutive visits were registered . Their demographic factors , concurrent medications , warfarin-related bleedings or thromboembolisms , smoking , alcohol intake and weekly green vegetable consumption were recorded . From a blood sample , DNA was isolated and genotyped by real-time PCR for polymorphisms of 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P11712

</mark>
 , Q9BQB6 ,

 and

 . A regression analysis was used to determine the independent effects of genetic and non-genetic factors on warfarin dose optimization . In our study , in addition to age , genetic variants of 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 , Q9BQB6 and

 were found to be significant predictor variables for the maintenance dose for warfarin , explaining 39.3 % of dose variability . Q9BQB6 and

 genotypes remain predictor variables of the warfarin dose , and we first found that 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

<div class="entities" style="line-height: 2.5; direction: ltr">Synthesis and biological evaluation of novel oxindole-based RTK inhibitors as anti-cancer agents . Given that receptor tyrosine kinases ( RTKs ) have emerged as key regulators of all aspects of cancer development , including proliferation , invasion , angiogenesis and metastasis , the RTK family represents an important therapeutic target for anti-cancer drug development . Oxindole structure has been used in RTK inhibitors such as 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB02058
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 and intedanib . In this study , two series of new heterocyclic compounds containing oxindole scaffold have been designed and synthesized , and their inhibitory activity against the proliferation of nine cancer cell lines has been evaluated . Among them , compounds 9a and 9b displayed the strongest anti-proliferative activity with the IC50s below 10M . Flow cytometric analysis showed that the compounds 9a and 9b dose-dependently arrested the cell cycle at G0 / P55008 phase . Although the leading compounds 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB02058

</mark>
 and intedanib targets 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P11362
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 , the kinase activity test revealed that these compounds only showed slight inhibitory activity on 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

<h2 style="margin: 0">8</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Q8N1N2 - spectrum antioxidant therapy featuring astaxanthin coupled with lipoprivic strategies and salsalate for management of non-alcoholic fatty liver disease . Owing to the worldwide epidemic of obesity , and the popularity of diets rich in sugar and saturated fat , nonalcoholic fatty liver disease ( NAFLD ) is increasingly common ; it is usually associated with insulin resistance , and may be considered a component of the metabolic syndrome . The pathologies which can complicate hepatic steatosis - - steatohepatitis , cirrhosis , and hepatic cancer - - appear to result from an interaction of hepatic lipid overload and hepatic oxidative stress . It is therefore proposed that comprehensive regimens which effectively target each of these precipitating factors should achieve the best therapeutic benefit in NAFLD . Appropriate weight loss , and a diet low in saturated fat , glycemic index , and added sugars , should decrease hepatic lipid load . Measures which enhance adipocyte insulin sensitivity - - such as pioglitazone , astaxanthin , and spirulina - - may also be helpful in this regard , as may agents that boost hepatocyte capacity for fatty acid oxidation , such as metformin , carnitine , hydroxycitrate , long-chain omega - 3 fats , and glycine . Astaxanthin and spirulina appear to have considerable potential for controlling the oxidative stress associated with NAFLD - the former because it may help to prevent the mitochondrial damage that renders mitochondria a key source of superoxide in this syndrome , the latter because it is exceptionally rich in phycocyanobilin , a phytochemical inhibitor of NAPDH oxidase . Other antioxidants which show some promise in this syndrome include high-dose folate , lipoic acid , melatonin , 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 , vitamin E , and taurine . Finally , treatment with salsalate , an inhibitor of 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 - beta , has potential for blunting the adverse impact of hepatic steatosis on oxidative stress and inflammation .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Modular synthesis of heparin oligosaccharides . A general , modular strategy for the first completely stereoselective synthesis of defined heparin oligosaccharides is described . Six monosaccharide building blocks ( four differentially protected glucosamines , one glucuronic and one iduronic acid ) were utilized to prepare di - and trisaccharide modules in a fully selective fashion . Installation of the alpha-glucosamine linkage was controlled by placing a conformational constraint on the uronic acid glycosyl acceptors thereby establishing a new concept for stereochemical control . Combination of disaccharide modules to form trans-uronic acid linkages was completely selective by virtue of 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P06681

</mark>
 participating groups . Coupling reactions between disaccharide modules exhibited sequence dependence . While the union of many glucosamine uronic acid disaccharide modules did not meet any problems , certain sequences proved not accessible . Elaboration of glucosamine uronic acid disaccharide building blocks to trisaccharide modules by addition of either one additional glucosamine or uronic acid allowed for stereoselective access to oligosaccharides as demonstrated on the example of a hexasaccharide resembling the 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 - binding sequence . Final deprotection and sulfation yielded the fully synthetic heparin oligosaccharides .</div>

<h2 style="margin: 0">18</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Current and future pharmacologic options for the management of patients unable to achieve low-density lipoprotein-cholesterol goals with statins . Low-density lipoprotein-cholesterol ( LDL-C ) lowering is the mainstay of the current treatment guidelines in the management of cardiovascular risk . 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P04035
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 inhibitors ( statins ) are currently the most effective LDL-C-lowering drugs . However , a substantial number of patients do not reach treatment targets with statins . Therefore , an unmet medical need exists for lipid-lowering drugs with novel mechanisms of action to reach the recommended cholesterol target levels , either by monotherapy or combination therapy . Upregulation of the 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P01130
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 with squalene synthase inhibitors has shown promising results in animal studies but the clinical development of the lead compound lapaquistat ( 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB05317
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 ) has recently been discontinued . DB00973 combined with statins allowed significantly more patients to reach their LDL-C targets . Other inhibitors of intestinal cholesterol absorption such as disodium ascorbyl phytostanol phosphate ( DB05449 ) and bile acid transport inhibitors have shown positive results in early development trials , whereas the prospect of acyl coenzyme A : cholesterol acyltransferase inhibition in cardiovascular prevention is dire . Selective inhibition of messenger RNA ( mRNA ) by antisense oligonucleotides is a new approach to modify cholesterol levels . The inhibition of apolipoprotein B mRNA is in advanced development and mipomersen sodium ( ISIS 301012 ) has shown striking results in phase II studies both as monotherapy as well as in combination with statins .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Helicobacter pylori-induced interleukin - 12 p40 expression . Interleukin - 12 ( IL - 12 ) is a heterodimeric cytokine produced by antigen-presenting cells that promotes the development of T-helper lymphocyte 1 ( Th1 ) . Chronic gastritis induced by Helicobacter pylori is considered a Th1 - mediated process . IL - 12 levels in gastric biopsy samples of H . pylori-infected patients are higher than in those of uninfected individuals , but the cellular source of IL - 12 remains elusive . IL - 12 staining was detected in mucosal epithelial cells , lymphocytes , and macrophages in specimens of patients with H . pylori-positive gastritis . Therefore , we investigated IL - 12 p40 mRNA induction by H . pylori in gastric epithelial cells and T cells . Although cag pathogenicity island ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P05121
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) - positive H . pylori induced IL - 12 p40 mRNA expression , an isogenic mutant of the cag 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P05121

</mark>
 failed to induce it in both cell types . Supernatants from H . pylori cultures and H . pylori VacA induced IL - 12 p40 mRNA expression in T cells but not in epithelial cells . The activation of the IL - 12 p40 promoter by H . pylori was mediated through NF-kappaB . The transfection of 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    O15111
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>

 and NF-kappaB-inducing kinase dominant-negative mutants inhibited H . pylori-induced IL - 12 p40 activation . Inhibitors of NF-kappaB , phosphatidylinositol 3 - kinase , p38 mitogen-activated protein kinase , and Hsp 90 suppressed H . pylori - and VacA-induced IL - 12 p40 mRNA expression . The results indicate that H . pylori induces IL - 12 p40 expression by the activation of NF-kappaB , phosphatidylinositol 3 - kinase , and p38 mitogen-activated protein kinase . Hsp 90 is also a crucial regulator of H . pylori-induced IL - 12 p40 expression . In addition to the cag

 , VacA might be relevant in the induction of IL - 12 expression and a Th1 - polarized response only in T cells .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">[ Additive antiproteinuric effect of angiotensin II receptor antagonist and angiotensin-converting enzyme inhibitor in patients with chronic glomerulonephritis ] . 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P30556
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 blocker ( ARB ) and angiotensin-converting enzyme inhibitor ( ACEI ) have been thought to be effective for reducing proteinuria in patients with chronic glomerulonephritis . Recently , an additive effect of these two types of angiotensin blockers has been reported in patients with IgA nephropathy , but the mechanism responsible for the effect has not yet been determined . In this study , we examined additive effect of these two drugs in chronic glomerulonephritis patients . Ten patients with biopsy-proven primary glomerulonephritis ( eight IgA nephropathy patients , two membranous nephropathy patients ) , non-nephrotic proteinuria ( protein , 0.5 to 3.5 g / day ) received candesartan cilexetil ( 2 or 4 mg ) for 8 weeks . After the 8 weeks , a combination of perindopril erbumine ( 1 or 2 mg ) and candesartan cilexetil was administered to the patients . DB00790 was stopped after the 8 - week administration of the two drugs . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB00796
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 alone reduced proteinuria by 13 % . Combination of these two drugs induced a more remarkable reduction of proteinuria ( 48 % ; p &lt; 0.05 vs other periods ) . The decrease in mean blood pressure by the combination therapy was significantly correlated with the decrease in proteinuria . The combination of drugs also reduced the amount of urinary type-IV collagen excretion . An additive effect of ACEI and ARB on proteinuria and urinary type-IV collagen excretion was recognized in patients with chronic glomerulonephritis .</div>
